import React from 'react';
import Balance from './Balance';

const Home = (props) => {

    return (
        <div>
            
            <Balance transactions={props.transactions} />
            
            <h3 className='history-title'>
                {props.transactions.length > 0 ? "History" : "Şu anda herhangi bir geliriniz veya gideriniz yok. Gelir/Gider sayfalarından bir miktar ekleyin"}</h3>
                <div className="history">
                <GiReceiveMoney />
                <TfiWrite />
                <FiCalendar />
                </div>
            <ul className='trackerList'>
                {props.transactions.map((transaction, index) => (
                    <li key={index} className="trackerlist-li">
                        {transaction.amount}TL  <span className={transaction.type}>{transaction.type}</span> {transaction.desc} {transaction.date}
                    </li>   

                ))}
            </ul>
        </div>
    )
}

export default Home
